// BlogPost.js
import React from "react";

const BlogPost = ({ post }) => (
    <div className="blog-post">
        <img src={post.image} alt={post.title} />
        <h2>{post.title}</h2>
        <p>{post.content}</p>
    </div>
);

export default BlogPost;
